	r = -1
else:
	c = a - b
	c = np.sort(c)
	if(c[0] >= 0):
		r = 0
	else:
		ii = -1
		for i in range(n):
			if(c[i] >= 0):
				ii = i
				break
		debt = np.sum(c[:i])
		for i in range(n):
			debt += c[n-1-i]
			if(debt >= 0):
				r = ii+(i+1)
				break
